import React from "react";
import images from "../../assets";
import { Container, Logo, Title } from "./styles";

function NavBar() {
  return (
    <>
      <Container>
        <Title> HOMESTEAD</Title>
        <Logo src={images.houseLogo}></Logo>
      </Container>
    </>
  );
}

export default NavBar;
